description:
Verenigde Staten
Drama
123 minuten

een goeie film

met Hilary Swank, April Lee Hernandez en Mario

Een nieuwe lerares heeft moeite met het gedrag van haar leerlingen. Al spoedig merkt ze dat die houding veroorzaakt wordt door 
de gruwelen waarmee ze op straat in aanraking komen. Ze begint met een nieuw project waarbij ze hen respect, tolerantie en 
andere waarden bij wil brengen. De interesse is in het begin niet groot, maar hoe verder het project komt, hoe groter de 
invloed op hun gedrag blijkt te zijn.
